import { jsx as _jsx } from "react/jsx-runtime";
/* eslint-disable no-console */
import '@testing-library/jest-dom';
import { render, screen, waitFor } from '@testing-library/react';
import { OverlayContainer } from './overlay-container';
describe('<OverlayContainer>', () => {
    test('it should be defined', () => expect(OverlayContainer).toBeDefined());
    test('it should render children properly', async () => {
        try {
            await waitFor(() => expect(_jsx(OverlayContainer, { children: "test" })).toBeDefined());
            await screen.findByText('test');
            const { baseElement } = render(_jsx(OverlayContainer, { children: "test" }));
            await waitFor(() => expect(baseElement).toMatchSnapshot());
        }
        catch (error) {
            console.error(error);
        }
    });
});
